movieApp={},movieApp.apiKey="12e9e2de03ebd1a7c3cfa3857fde0e3f",movieApp.searchMovie=function(){$.ajax("https:api.themoviedb.org/3/search/movie",{type:"GET",dataType:"json",data:{api_key:movieApp.apiKey,query:movieApp.movieTitle},success:function(e){var i=e.results[0].id;movieApp.searchCharacters(i)}})},movieApp.searchCharacters=function(e){$.ajax("https:api.themoviedb.org/3/movie/"+e+"/credits",{type:"GET",dataType:"json",data:{api_key:movieApp.apiKey},success:function(e){movieApp.displayCharacters(e)}})},movieApp.displayCharacters=function(e){for(i=0;8>=i;i++){var p=e.cast[i].character;$(".name"+i).html(p),console.log(p)}},movieApp.init=function(){movieApp.searchMovie()},$(function(){$("input[type=submit]").on("click",function(){movieApp.movieTitle=$("input[type=text]").val(),movieApp.init()})});